                    <div>100</div>
                </button>
                <Bar />
                <button className="tickers_stock">
                    <div>MRNA</div>
                    <div>100</div>
                </button>
            </div>
        </div>
    )
}

function Bar(){
    return(
        <hr  style={{
            borderColor: '#869196',
